        justifyContent: 'center',
        alignItems: 'center',
        padding: '1vw 3vw 0 3vw',

    }

    const copyright = {
        fontSize: '10px',
        fontWeight: '100',
        letterSpacing: '2px',
        margin: 0,

    }

    const imgCont = {
        width: '15vw',
    }

    const logoImg = {
        width: 'inherit',
    }

    return (
        <div style={ footer }>
            <div style={ imgCont }>
                <img src="/images/cbsiLogo2.png" alt="CBSI Logo" style={logoImg}/>
            </div>

            <p style={ copyright }>Copyright Â© 2020 CBSI. All rights reserved.</p>
        </div>
    );
}

export default Footer;
